export const ADD_NAME = 'ADD_NAME';

export const addName = (payload) => ({
  type: ADD_NAME,
  payload,
});

export const EDIT_PROFILE = 'EDIT_PROFILE';

export const editProfile = (payload) => ({
  type: EDIT_PROFILE,
  payload,
})
